import React from "react";
import { todoType } from "../store/todoReducer";
import Item from "../Item/Item";

function TodoList(todo: todoType[]) {
	return (
		<section>
			{todo.map((ele) => (
				<Item key={ele.id} {...ele} />
			))}
		</section>
	);
}

export default TodoList;
